import React, {useEffect, useState} from 'react';
import './App.css';
import CandidateService from "./services/CandidateService";

const App = () => {
  const [candidates, setCandidates] = useState([]);

  useEffect( () => {
    CandidateService.getCandidates()
  } )
}

export default App;
